import React, {useEffect} from 'react'
// MaterialUI Elements
import Grid from '@mui/material/Grid';

import * as adminApi from "../../../api/admin"
import SeasonsItems from './seasonItems';

export default function SeasonsList() {

    useEffect(() => {
        async function getData() {
            const seasons = await adminApi.getAllSeasons
        }
    })


    console.log(seasons)
    return (
        <div>
            <h1>All available products</h1>
            <Grid container spacing={3}>
                {seasons.map(product => (
                    <Grid 
                        item 
                        xs={12} 
                        sm={6} 
                        md={4} 
                        xl={3} 
                        key={product.PRODUCT_ID}
                    >
                        <h1>Hi</h1>
                        <SeasonsItems {...seasons} key={seasons.SEASON_ID}/>
                    </Grid>
                ))}
            </Grid>
        </div>
    )
}

SeasonsList.getInitialProps = async () => {
    const response = await adminApi.getAllSeasons()
    return {props: response}
}
